import React from "react";
import { Menu } from "antd"
import { AppstoreOutlined, CustomerServiceOutlined, HomeOutlined, OrderedListOutlined, ShopOutlined, ShoppingCartOutlined, TagOutlined, UserOutlined } from "@ant-design/icons";
export default function SideMenu() {
    return (
        <div className="SideMenu">

            <Menu
                onClick={(item) => {
                    //item.key
                }}
                items={[
                    {
                        label: "Dashboard",
                        icon: <AppstoreOutlined />,
                        key: '/',
                    },
                    {
                        label: "Dơn hàng",
                        key: '/orders',
                        icon: <ShoppingCartOutlined />
                    },
                    {
                        label: "Dịch vụ",
                        key: '/inventory',
                        icon: <ShopOutlined />
                    },
                    {
                        label: "Khách hàng",
                        key: '/customers',
                        icon: <UserOutlined />
                    },
                    {
                        label: "Khuyến mãi",
                        key: '/tags',
                        icon: <TagOutlined />
                    },
                ]}
            >

            </Menu>
        </div>
    )
}
